import "./App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Footer from "./Footer";

function App() {
  return (
    <div className="App">
      <Router>

        <Routes>
          <Route path="/admin" element={<Footer />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
